from collections import defaultdict

def is_tree_possible(N, a):
    D = defaultdict(int)
    a = sorted(a)
    if N != 2:
        if a[0] != 1 or a[1] != 1:
            return 'Impossible'
        else:
            return 'Possible'
    else:
        for i in range(N):
            D[a[i]] += 1
        if a[-1] % 2 != 0:
            if a[0] * 2 - 1 != a[-1]:
                return 'Impossible'
            else:
                judge = 'Possible'
                if D[a[0]] != 2:
                    judge = 'Impossible'
                for i in range(a[0], a[-1] + 1):
                    if D[i] < 2:
                        judge = 'Impossible'
                        break
                return judge
        else:
            judge = 'Possible'
            if a[0] * 2 != a[-1]:
                return 'Impossible'
            else:
                judge = 'Possible'
                if D[a[0]] != 1:
                    judge = 'Impossible'
                for i in range(a[0] + 1, a[-1] + 1):
                    if D[i] < 2:
                        judge = 'Impossible'
                        break
                return judge

